import { SUCCESS_COUPON, FAILED_COUPON } from "./type";
import axios from "axios";

const getCouponByName = (name) => async (dispatch) => {
  try {
    const res = axios.get(`http://localhost:8000/coupon/${name}`);
    dispatch({
      type: SUCCESS_COUPON,
      payload: res.data,
    });
  } catch (err) {
    dispatch({
      type: FAILED_COUPON,
      payload: err.message,
    });
  }
};
